import styled from "styled-components";
import { Row, Typography, Radio, Input, Alert } from "antd";
const { Title, Paragraph, Text } = Typography;

function Card({ results }) {
  return (
    <>
      <Title level={2}>Результат: {}</Title>
      <Paragraph>{results[0]}</Paragraph>
      <Paragraph>{results[1]}</Paragraph>
    </>
  );
}

export default Card;
